}, []);

const AnimatedKody = () => {
  return (
    <div className="relative h-[16.6em] w-[20em] mx-auto scale-110">
      <img
        Src={body}
        alt="kody"
        width={150}
        className="absolute top-[8.1em] left-1/2 -translate-x-1/2"
      />
      <img
        src={wingLeft}
        alt="kody"
        width={90}
        className="absolute top-[8.5em] left-6"
      />
      <img
        src={wingRight}
        alt="kody"
        width={90}
        className="absolute top-[8.5em] right-6"
      />
      <img
        src={footLeft}
        alt="kody"
        width={50}
        className="absolute bottom-0 left-24"
      />
      <img
        src={footRight}
        alt="kody"
        width={50}
        className="absolute bottom-0 right-24"
      />
      <img
        src={head}
        alt="kody"
        width={200}
        className="absolute top-0 left-1/2 -translate-x-1/2"
      />
    </div>
  );
};

export default AnimatedKody;
